var lz=(n,e)=>(+n+Math.pow(10,e)+'').substr(1);
var rb=()=>Math.random()<0.5;
var rm=m=>~~(Math.random()*m);
var rr=(n,x)=>Math.round(Math.random()*(x-n))+n;
var rn=(n,x)=>{let r=Math.random();return !x?(!n?r<0.5:~~(r*n)):Math.round((r*(x-n))+n)}
var nc=n=>(n+'').replace(/\B(?=(?=\d*\.)(\d{3})+(?!\d))/g,',');
var mc=(n,d)=>{d=d!==void(0)?d:2;return ('$'+n.toFixed(d)).replace(/\B(?=(?=\d*\.)(\d{3})+(?!\d))/g,',')}
var ro=a=>{var b=a.slice(0),c=[];while(b.length){c.push(b.splice(Math.floor(Math.random()*b.length),1)[0])}return c}
var fy=a=>{for(var b=a.slice(0),i=0,l=b.length,j,t;i<l;i++){j=~~(Math.random()*(l-i))+i;t=b[i];b[i]=b[j];b[j]=t}return b}
var as=a=>a.slice().sort(function(){return Math.random()-.5})
var td=()=>{if(!td.t)td.t=new Date();else{td.r=new Date()-td.t;td.t=0;return td.r}}
var ni=n=>[].indexOf.call(n.parentNode.children, n);
var mt=(t,d)=>{for(var i in d){t=t.replace(RegExp('\{\{'+i+'}}','g'),d[i]);}return t;}
var ra=(r,s,c)=>{for(var i in r)c=c.replace(r[i],s[i]);return c}
